import React from 'react';

export const CardDetails = ({image, name, temperament, height, weight, lifeSpan}) => {
    return (
        <>
            <div>
                <h1>{name}</h1>
                <h3>{temperament}</h3>
                <img src={image} alt="" />
                <p>{height}</p>
                <p>{weight}</p>
                <p>{lifeSpan}</p>
            </div>
        </>
    )
};
